import React, { useState } from "react";
import emailjs from "emailjs-com";
import logo from "./assets/logo.png";
import successImage from "./assets/success.png";
import { motion } from "framer-motion";

function App() {
  const [formData, setFormData] = useState({ name: "", email: "", message: "" });
  const [submitted, setSubmitted] = useState(false);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // 1ï¸âƒ£ Send confirmation to USER
    emailjs.send(
      "service_ted5m2h",
      "template_5qmfosa",
      {
        name: formData.name,
        email: formData.email,
      },
      "D8Cr-U9g1MVqsc5bv"
    ).then(() => {
      console.log("Confirmation sent to user");
    });

    // 2ï¸âƒ£ Send alert to ADMIN
    emailjs.send(
      "service_ted5m2h",
      "template_nzvxr9o",
      {
        name: formData.name,
        email: formData.email,
        message: formData.message,
      },
      "D8Cr-U9g1MVqsc5bv"
    ).then(() => {
      console.log("Alert sent to admin");
    });

    setSubmitted(true);
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-teal-100 to-blue-100 font-sans text-gray-800">
      {/* Header */}
      <header className="flex justify-between items-center p-6 bg-white shadow-md sticky top-0 z-10">
        <div>
          <h1 className="text-2xl font-bold">SafeCircle</h1>
          <p className="text-sm italic">when no one listens, we do</p>
        </div>
        <img src={logo} alt="Logo" className="h-12 w-auto" />
      </header>

      {/* Pricing */}
      <section className="text-center py-10">
        <h2 className="text-3xl font-bold mb-2">Session Pricing</h2>
        <p className="text-lg">Choose from: â‚¹99 | â‚¹199 | â‚¹200</p>
      </section>

      {/* Booking Form */}
      <section className="flex flex-col items-center justify-center px-4 py-12">
        <motion.div
          className="w-full max-w-lg p-8 bg-white rounded-2xl shadow-xl"
          initial={{ opacity: 0, y: 50 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
        >
          {!submitted ? (
            <form onSubmit={handleSubmit} className="space-y-6">
              <h2 className="text-2xl font-semibold text-center">Book a Session</h2>
              <input
                type="text"
                name="name"
                placeholder="Your Name"
                value={formData.name}
                onChange={handleChange}
                className="w-full px-4 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-400"
                required
              />
              <input
                type="email"
                name="email"
                placeholder="Your Email"
                value={formData.email}
                onChange={handleChange}
                className="w-full px-4 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-400"
                required
              />
              <textarea
                name="message"
                placeholder="Describe your concern"
                value={formData.message}
                onChange={handleChange}
                className="w-full px-4 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-400"
              ></textarea>

              <label className="font-bold">Upload Payment Success Image</label>
              <input
                type="file"
                accept="image/*"
                className="w-full border border-gray-300 px-3 py-2 rounded-md"
                required
              />

              <button
                type="submit"
                className="w-full py-2 px-4 bg-teal-500 hover:bg-teal-600 text-white font-bold rounded-md shadow-lg transition"
              >
                Submit
              </button>
            </form>
          ) : (
            <div className="text-center">
              <img src={successImage} alt="Success" className="w-24 mx-auto mb-4" />
              <h3 className="text-xl font-semibold text-green-600">Booking Successful!</h3>
              <p>We've received your request and will get in touch soon.</p>
            </div>
          )}
        </motion.div>
      </section>

      {/* Footer */}
      <footer className="text-center p-6 bg-white border-t mt-10 text-sm">
        <p>&copy; {new Date().getFullYear()} SafeCircle | Built with ðŸ’™</p>
      </footer>
    </div>
  );
}

export default App;
